// base
import React from 'react';
import PropTypes from 'prop-types';

// assets
import 'antd/dist/antd.css';

const App = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

App.propTypes = {
  Component: PropTypes.element.isRequired,
};

export default App;
